Older Kid: Mom, what’s ‘shade’?

@KarinWeekes: It’s when you say something that seems nice, but there’s an insult hidden in it. Like if I said... argh, I’m having trouble thinking of an example of good shade.

Me, hearing this from across the house: https://t.co/Gw0zOXxWw3

@Anthony41806183 Because he’s a traitor. NO ONE cares about the shade of her skin. It’s the darkness of her heart that the masses detest.
Stop playing toxic racial games.
It’s creepy.
